INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("アヤネ", 0.0, 102301, 24001, 401, 24, 2, 2, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("アヤネ", 2.21, 102301, 24002, 402, 24, 1, 2, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("アヤネ", 0.0, 102301, 24003, 403, 24, 2, 2, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("アサヒ", 1.99, 192201, 24004, 701, 24, 2, 1, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("アサヒ", 2.21, 192201, 24005, 702, 24, 1, 2, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("アサヒ", 3.33, 192201, 24006, 703, 24, 2, 1, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("部員３", 0.0, 192301, 24007, 801, 24, 2, 2, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("部員３", 2.68, 192301, 24008, 802, 24, 1, 2, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("部員３", 0.0, 192301, 24009, 803, 24, 2, 2, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("", 0.0, 192501, 24010, 501, 24, 1, 1, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "やった！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("", 0.0, 192501, 24011, 502, 24, 1, 1, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "勝ったよ！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("", 0.0, 192501, 24012, 503, 24, 1, 1, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "いい調子！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("ミサト", 5.33, 113501, 24013, 111, 24, 6, 2, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("ミサト", 6.85, 113501, 24014, 112, 24, 1, 2, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("ミサト", 3.0, 113501, 24015, 113, 24, 1, 2, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("ダイチ", 6.11, 192401, 24016, 611, 24, 1, 2, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("ダイチ", 6.75, 192401, 24017, 612, 24, 1, 2, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("ダイチ", 0.0, 192401, 24018, 613, 24, 2, 2, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("ハツネ", 4.52, 113401, 24019, 211, 24, 2, 1, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("ハツネ", 3.89, 113401, 24020, 212, 24, 2, 1, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("ハツネ", 13.49, 113401, 24021, 213, 24, 1, 2, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("カヤ", 3.17, 106501, 24022, 311, 24, 1, 2, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("カヤ", 4.42, 106501, 24023, 312, 24, 1, 2, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("カヤ", 2.89, 106501, 24024, 313, 24, 6, 1, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("アヤネ", 3.71, 102301, 24025, 421, 24, 4, 3, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("アサヒ", 5.1, 192201, 24026, 721, 24, 2, 1, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("部員３", 4.34, 192301, 24027, 821, 24, 1, 3, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("", 0.0, 192501, 24028, 521, 24, 1, 1, 10046, "2020/07/31 12:00:00", 0.0, "2030/12/17 14:59:59", "いい勝負だったよ\nまたやろうね", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("ミサト", 5.62, 113501, 24029, 101, 24, 1, 2, 10046, "2020/07/31 12:00:00", -360.0, "2030/12/17 14:59:59", "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("ミサト", 9.58, 113501, 24030, 102, 24, 1, 2, 10046, "2020/07/31 12:00:00", -360.0, "2030/12/17 14:59:59", "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("ミサト", 0.0, 113501, 24031, 103, 24, 2, 2, 10046, "2020/07/31 12:00:00", -360.0, "2030/12/17 14:59:59", "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("ミサト", 9.13, 113501, 24032, 104, 24, 2, 1, 10046, "2020/07/31 12:00:00", -360.0, "2030/12/17 14:59:59", "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 0.0);
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES ("ミサト", 8.27, 113501, 24033, 105, 24, 1, 2, 10046, "2020/07/31 12:00:00", -360.0, "2030/12/17 14:59:59", "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 0.0);
